import VueRouter from 'vue-router'
import Main from './pages/MainPage'
import Add from '/pages/AddPage'

export default new VueRouter({
    routes: [
      {
        path:'/',
        component: Main
      },
      {
        path:'/add',
        component: Add
      }

    ]
})
